The next three macrocarpals (25), (27) and (28) had monoisotopic mass 386.2093 Da and molecular formula C23H29O5 (
 Table 1). Earlier, compounds with the same masses were identified in the Eucalyptus plants as euglobales (
 Umehara et al., 1998; 
 Eschler et al., 2000; 
 Singh and Bharate, 2006). However, the presence in the MS/MS spectrum of intensive diagnostic fragment with m/z 207.03 indicates that these are apparently some unknown macrocarpals (
 Table 1).
